import { API_URL } from "../config.js";

export const LOGIN = `${API_URL}/api/login/`;

export const REGISTER = `${API_URL}/api/register/`;

export const CREATETODO = `${API_URL}/api/createTodo/`;

export const LIST = `${API_URL}/api/todoList/`;

export const DELETE = `${API_URL}/api/dltTodo`;
